import React from "react";
import { useParams } from "react-router-dom";
import styled from "styled-components";

import { CoursePreview } from "../domain/courses";
import { SearchModal } from "../domain/search";

import { Title2 } from "../atoms/text";
import { COLOR } from "../constants";

const SearchPage = () => {
  const { keyword } = useParams();
  const { loading: loading, data: courses, error: error } = useAxiosGet(
    `http://localhost:8081/api/v1/courses?keyword=${keyword}`
  );
  if (loading) {
    console.log("loading...");
  }
  if (error) {
    console.log("error!");
  }
  return (
    <Container>
      <SearchModal></SearchModal>
      <Title2 margin={"1rem"} color={COLOR.WHITE}>
        검색된 코스가 {}개 있어요.
      </Title2>
    </Container>
  );
};
export default SearchPage;

const Container = styled.div`
  width: 100%;
`;
